    return(
        <form>
        <input 
        className="login-input"
        placeholder="Digite seu nome"
        />
        <div className="container-btn">
                <Link to="/gamepage">
                    <button className="btn">Cadastre-se</button>
                </Link>
            </div>
        </form>

    )
}
export default Home;
